INSERT INTO `tab_best_couple` (`id`, `lady_name`, `lady_company`, `lady_email`, `lady_contact`, `gent_name`, `gent_company`, `gent_email`, `gent_contact`, `desc_firstmeeting`, `desc_eachother`, `desc_rolemodel`, `desc_partner`, `text_like`, `status`) VALUES
(12, 'Ninu Augustine', 'RMESI', 'ninuben@gmail.com', '9647303432', 'Asher Ben', 'Ruby Software', 'asherisfine@gmail.com', '9995937122', 'We met at a church and just after the mass, I had proposed her. Took us 2 months of calls and emails to know that we are made for each other.', 'We are exact opposites in everything from creativity to time management to Emotional stability to everything. But \"Opposites attract each other\"', 'Since we are opposites , I think we complement each other as role models. Indeed most of our motivation comes from how the other is faring in a particular field.', 'We already have \"Us\". Should we even search for ideal partners ?', 'A bland soup, she adds the spices to my life.', 'Y'),
(13, 'Chitra P Nair', 'RR DONNELLEY', 'chitra.nair@rrd.com', '9495651092', 'Vinodh P Mohanan', 'RR DONNELLEY', 'vinodh.mohanan@rrd.com', '9995105771', NULL, NULL, NULL, NULL, NULL, 'N'),
(14, 'Gowri G R', 'IBS Software Services', 'gowri.ramachandran@ibsplc.com', '8129782845', 'Amit Ranjan', 'IBS Software Services', 'amit.ranjan@ibsplc.com', '8129446183', NULL, NULL, NULL, NULL, NULL, 'N'),
(15, 'Shalini J Nair', 'RM Education Solution India Pvt Ltd', 'shalinijnair@gmail.com', '9037076661', 'Manish M Pillai', 'RM Education Solution India Pvt Ltd', 'manishpillai1989@gmail.com', '8129748854', 'It was when she came for an interview in my company. She was sitting in the lobby and we happened to get a glimpse of each other. She nervously asked me where is the HR.', 'I am a very calm person by nature. I don\'t tend to react when people irritate or annoy me, which is good in some sense, however when they cross their limits, she is there to react and standup for me (which is neutral when she faces the same). \r\nShe is emotional and sensitive kind of a person and that is where I become a shoulder for her; help her being practical and take decisions sensibly.', 'We both are very close to our families, so our role models are our parents. The reason behind this is the way our parents have brought us up and manage their personal and professional lives meanwhile.', 'One who is loving, understanding, best critic and who can guide us for a lifetime.', 'a traveller on a journey without destiny.', 'Y');
