INSERT INTO `tab_events` (`events_id`, `project_id`, `events_title`, `page_name`, `events_description`, `short_description`, `events_image`, `events_thumb_image`, `events_video`, `events_date`, `events_hour`, `events_minutes`, `events_venue`, `events_publish`, `events_priority`) VALUES
(6, NULL, 'Resource Meet', 'ResorceMeet', 'Resource Meet', 'Technopark', '', 'thumbs/', '', '2011-01-31', 14, 0, 'Travancore Hall', 1, 1),
(7, NULL, 'Audition', 'audition', '<b>Singing   </b><br>\r\nPerformance Time  : 3 minutes for a Participant <br>\r\nCategories  : Classical, Western, Film Songs, Carnatic, Light Music <br>\r\nParticipant will be asked to perform on any of the above mentioned categories  <br><br>\r\n  \r\n<b>Acting   </b><br>\r\nPerformance Time  : 3 minutes for a Participant <br>\r\nA theme will be given to each participant on which he/she has to perform  \r\n', 'First Day', '', 'thumbs/', '', '2011-02-17', 11, 0, 'Daffodils Hall, Club House', 1, 2),
(8, NULL, 'Audition ', 'Audition', '<b>Dance</b>   <br>\r\nPerformance Time  : 5 minutes for a Participant <br>\r\nCategories  : Classical, Cinematic, Contemporary  <br>\r\nThe participant has to opt any of the Category mentioned above, can bring his/her on tracks, or else track will be provided by the jury  <br><br>\r\n  \r\n<b>Fashion</b>   <br>\r\nThe participant will be asked to do a walk on the Ramp per the track played  \r\n', 'Second day', '', 'thumbs/', 'http://www.youtube-nocookie.com/v/-wz3aVxF_tQ?fs=1&hl=en_US', '2011-02-18', 11, 0, 'Daffodils Hall, Club House', 1, 2),
(9, NULL, 'Natana Launch', 'natana-launch-technopark', 'Happy to give you a sneak peek into the plans for the Big Day! <br><br>\r\nOn the dusk of 7th of April, 2011 @ the Amphitheatre;  Natana, the Fine Arts Club of, for & by Technoparkians will be flagged off  by the  well-liked star actor of South Indian movie industry <b><span class=\\\"reg_header\\\">Prithviraj</span></b> himself! <br><br>\r\nThe inaugural ceremony will be followed by a breathtaking variety show by the Technopark community. Drama, dance, stunt, fashion, music; whichever is your pick we\\\'ve it in our goodie hamper.<br><br>\r\n\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tr>\r\n<td width=\\\"400\\\" valign=\\\"top\\\">Last but not least, experience the power-packed Rock act by  the very popular band which has now become the  pride of Kerala - <b><span class=\\\"reg_header\\\">Avial</span></b>. <br><br><br>\r\nReady or not, here we come to rock your world!!! \r\n\r\n</td><td width=\\\"30\\\"></td>\r\n<td width=\\\"160\\\"><a href=\\\"http://www.avial.in/\\\" target=\\\"_blank\\\"><img src=\\\"http://www.natana.in/images/avial_logo.jpg\\\" border=\\\"0\\\">\r\n</td></tr></table>\r\n\r\n<br><br><br>\r\n<b>Official Media Partners:</b><br><br>\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tr><td width=\\\"160\\\"><a href=\\\"http://www.radiomirchi.com/\\\" target=\\\"_blank\\\"><img src=\\\"http://www.radiomirchi.com/main/images/logo.png\\\" border=\\\"0\\\" width=\\\"140\\\"></a>\r\n</td>\r\n<td width=\\\"150\\\">\r\n<img src=\\\"http://www.natana.in/images/rblogo_bigger.jpg\\\" border=\\\"0\\\">\r\n</td>\r\n</tr>\r\n</table>', 'Technopark', '', 'thumbs/', '', '2011-04-07', 19, 0, 'Amphitheatre', 1, 1),
(10, NULL, 'Kathakali Nite', 'technopark-natana-kathakali-nite-by-sethu', 'After the larger than life launch that touched the hearts of all Technoparkians; we are back with the next programme. <br><br>\r\n\r\nThe choice of what we needed to do next was difficult given the acceptance the launch event received. We finally zeroed in on a <b><span class=\\\"reg_header\\\">Kathakali</span></b>, the art form that stands out due to the sheer beauty it portrays through its mesmerizing mudras and vibrant colours.  \r\n<br><br>\r\nKathakali is a highly stylized classical Indian dance-drama noted for the attractive make-up of the performers. It originated in the country\\\'s present day state of Kerala during the 17th century and has developed over the years with improved looks, refined gestures and added themes besides more ornate singing and precise drumming.\r\n<br><br>\r\n<b><span class=\\\"reg_header\\\">Sethu</span></b> is presently working with IBS and heads the IBS ASP Operations.  He has over 13 years of experience in the industry and has worked in Middle East and Singapore in various capacities specializing in Oracle and Database Administration.\r\n<br><br>\r\nSethu started learning Kathakali at the age of nine under reputed teachers including Kalamandalam Sreekumar (Head of Kathakali, RLV COllege, Tripunithura). He has performed  professionally in different temples and kathakali clubs. Currently he is practicing under Kalamandalam Ratheesan (Principal, Margi). \r\n<br><br>\r\nSethu is actively involved in promoting kathakali online. He started a group for Kathakali in Facebook which serves as a platform for a lot of creative initiatives and healthy discussions. He has also contributed actively to various online sites like kathakali.info. He is also a prolific blogger (nishkkalankan.blogspot.com) \r\n<br><br>\r\nSethu is from Alappuzha. Currently he is staying in Trivandrum with wife Vidya and daughter Madhuchandra. \r\n<br><br>\r\n<b><span class=\\\"reg_header\\\">Programme schedule</span></b>: \r\n<br><br>\r\n<b>Kalyanasaugandhikam Kathakali</b>\r\n<br><br>\r\n5:00 pm - Kelikottu<br>\r\n6:00 pm - Introduction<br>\r\n6:25 pm - Arangu Keli<br>\r\n6:30 pm - Kathakali <br>\r\n<br><br>\r\n<b>Artists: </b> \r\n<br><br>\r\nHanuman - Kalamandalam Ratheeshan<br>\r\nBhima - Sethunath Nair, IBS, Technopark<br>\r\nPanchali - Margi Sukumaran<br>\r\nChenda - Margi Venugopal<br>\r\nMaddalam - Margi Ratnakaran<br>\r\nSongs - Kalanilayam Rajeevan, Tripunithura Arjun<br>\r\nChutti - RLV Somdas<br>\r\nCostumes - Margi Gopan and Party\r\n<br><br>\r\n<img src=\\\'/images/ico_pdf.gif\\\'> <a href=\\\'/images/Kalyanasaugandhikam_Story.pdf\\\' target=\\\'_blank\\\' style=\\\"text-decoration: none;outline: none; color: #BBBBBB\\\"><span class=\\\"reg_header\\\">Download Story Line</span></a>\r\n<br><br>\r\n<a href=\\\'http://kathakali.info/node/49\\\' target=\\\'_blank\\\' style=\\\"text-decoration: none;outline: none; color: #BBBBBB\\\"><span class=\\\"reg_header\\\">http://kathakali.info/node/49</span></a>\r\n\r\n\r\n<br><br><br>\r\n<b>Official Partners:</b><br><br>\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tr><td width=\\\"160\\\"><a href=\\\"http://www.radiomirchi.com/\\\" target=\\\"_blank\\\"><img src=\\\"http://www.radiomirchi.com/main/images/logo.png\\\" border=\\\"0\\\" width=\\\"140\\\"></a>\r\n</td>\r\n<td width=\\\"150\\\"><a href=\\\"http://www.omanair.com/\\\" target=\\\"_blank\\\"><img src=\\\"http://www.omanair.com/wy/sites/all/themes/omanair/images/logo_new.gif\\\" border=\\\"0\\\" width=\\\"140\\\" alt=\\\"Omanair\\\"></a>\r\n</td>\r\n</tr>\r\n</table>', 'By Sethunath Nair, IBS', '', 'thumbs/', '', '2011-06-16', 5, 0, 'Amphi theatre', 1, 1),
(11, NULL, 'Inauguration of the Cancer Awareness Foundation', 'technopark-natana-inauguration-cancer-awareness-foundation-mukesh-the-kerala-club', ' NATANA  has  join   hands with Kerala Club(Detroit) and Mukesh Foundation to launch one of the biggest corporate social responsibility initiatives that Kerala has ever witnessed. \r\n<br><br>\r\n<img src=\\\'../cancer.jpg\\\' width=\\\'600\\\'>', 'Technopark', '', 'thumbs/', '', '2011-07-20', 19, 0, 'Travancore Hall, Park Center', 1, 1),
(12, NULL, 'Photography workshop', 'technopark-photography-workshop-by-balan-madhavan', '<br><b><span class=\\\"reg_header\\\">Shutterbugs!</span></b>\r\n<br><br>\r\nHave you been wanting to learn more about photography? \r\n<br><br>\r\nDSLR or a \\\'point and shoot\\\' camera; grab one and come over to\r\n<br><br>\r\n<b>TRAVANCORE HALL, PARK CENTRE, TECHNOPARK.</b>\r\n<br><br>\r\nOn <b>NOVEMBER 5th</b>\r\n<br><br>\r\nIt\\\'s Kerala\\\'s best photographer <b><span class=\\\"reg_header\\\">BALAN MADHAVAN</span></b> conducting a workshop on Basic photography.\r\n<br><br>\r\n<b>Fees - INR 1000.</b>\r\n<br><br>\r\nThe workshop is open to all who want to know the ABCs of photography.\r\n<br><br>\r\nFor registrations contact:\r\n<br>\r\nSubin, IBS - 9495871947<br>\r\nDeepa S Babu, UST - 9809998959<br>\r\nSrijith Vallathol, Infosys - 9567574892<br>\r\nRanjith Vallathol, Alamy - 8086880245<br>\r\nAthul Nath, Pits - 9447318574\r\n<br><br>\r\nBalan Madhavan\\\'s work can be found on -\r\n<br>\r\n<a href=\\\'http://www.balan.in/\\\' target=\\\'_blank\\\' style=\\\"text-decoration: none;outline: none; color: #BBBBBB\\\"><span class=\\\"reg_header\\\">http://www.balan.in/</span></a>\r\n\r\n \r\n<br>\r\n \r\n<a href=\\\'http://www.ilcp.com/photographers/balan-madhavan\\\' target=\\\'_blank\\\' style=\\\"text-decoration: none;outline: none; color: #BBBBBB\\\"><span class=\\\"reg_header\\\">http://www.ilcp.com/photographers/balan-madhavan</span></a>\r\n\r\n<br><br>\r\n<br>\r\nNote - This is the first of a series of photography programmes NATANA will conduct. This workshop will be soon followed up by a two day photography camp at Ponmudi.\r\n', 'Technopark', '', 'thumbs/', '', '2011-11-05', 9, 0, 'Travancore Hall, Park center', 1, 1),
(13, NULL, 'Auditions for NATANA musical band ', 'audition-natana-musical-band-singing', 'The stage is set, <br> <br> \r\nIt\\\'s time for the talents,  <br> <br>\r\nCan you make the crowd tap to your cadence and sway with your voice?  <br> <br>\r\nThis could be your free ride to fame!  <br> <br>\r\nCalling vocalists and musicians for the new musical band of NATANA to be launched early 2012.  <br> <br>\r\nSign in for an audition and impress us!  <br> <br>\r\n\r\n\r\n', 'Singing', '', 'thumbs/', '', '2011-11-15', 10, 0, 'Club house', 1, 1),
(14, NULL, 'Auditions for NATANA musical band ', 'audition-natana-musical-band-instrumental', 'The stage is set, <br> <br> \r\nIt\\\'s time for the talents,  <br> <br>\r\nCan you make the crowd tap to your cadence and sway with your voice?  <br> <br>\r\nThis could be your free ride to fame!  <br> <br>\r\nCalling vocalists and musicians for the new musical band of NATANA to be launched early 2012.  <br> <br>\r\nSign in for an audition and impress us!  <br> <br>\r\n\r\n', 'Instrumental', '', 'thumbs/', '', '2011-11-19', 10, 0, 'Club house', 1, 1),
(15, NULL, 'Nakshatra Deepangal', 'technopark-musical-night-nakshatra-deepangal', 'Let\\\'s rekindle the memories and melodies of three legends the Malayalam musical industry was blessed with. They leave behind the proud legacy of a bygone era which added a nip of flush to many dreams and whose music and verses still linger in many minds. <br><br>\r\n \r\n \r\nNATANA pays its tribute to the musical maestros M.G. Radhakrishnan, Johnson Master and the most coveted of lyricists Gireesh Puthenchery through <b><span class=\\\"reg_header\\\">\\\'Nakshatra Deepangal\\\'</span></b> - a musical night on the <b>8th</b> of <b>December 2011</b> at the <b>Amphitheatre, Technopark</b>.\r\n <br> <br>\r\n \r\nJoin us as we re-live their memories through the voices of talents from Technopark, egged on by two sprouting playback singers <b>Sudeep</b> and <b>Akhila</b>. <br> <br>\r\n<div id=\\\"events_single_container\\\"></div><br>\r\n\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tr><td width=\\\"50\\\"> \r\n</td><td width=\\\"330\\\"><a href=\\\"../natana-musical-night.jpg\\\" target=\\\"_blank\\\"><img src=\\\"../natana-musical-night.jpg\\\" width=\\\"200\\\" border=\\\"0\\\"></a>\r\n</td>\r\n<td valign=\\\"top\\\"><b>Official Partners:</b><br><br>\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tr><td width=\\\"160\\\"><a href=\\\"http://www.shoppingfestival.in/\\\" target=\\\"_blank\\\"><img src=\\\"../natana-grand-kerala-shopping-festival.gif\\\" border=\\\"0\\\" width=\\\"140\\\"></a>\r\n</td>\r\n<td width=\\\"170\\\" valign=\\\"top\\\"><br><br><a href=\\\"http://www.radiomirchi.com/\\\" target=\\\"_blank\\\"><img src=\\\"http://www.radiomirchi.com/main/images/logo.png\\\" border=\\\"0\\\" width=\\\"140\\\"></a><br><br><br><br><a href=\\\"http://www.zincnrock.com/\\\" target=\\\"_blank\\\"><img src=\\\"http://www.zincnrock.com/images/stories/logo.png\\\" border=\\\"0\\\" width=\\\"140\\\"></a></td>\r\n</tr>\r\n</table></td>\r\n</tr>\r\n</table>\r\n\r\n<br><div id=\\\"events_single_container\\\"></div><br>\r\n\r\n      <div id=\\\"events_single_container\\\">\r\n                    	<span class=\\\"singers-header\\\">Meet the talents from Technopark, whose voices would cradle your evening on the 8th of December.</span>\r\n<br><br>\r\nCo-ordinators of the event:<br><br>\r\n\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tr><td width=\\\"200\\\"><img src=\\\"../images/event_coordinators.jpg\\\" border=\\\"0\\\">\r\n</td>\r\n<td valign=\\\"top\\\"><b>Sreehari </b><br>\r\n\r\nRight from his childhood music has always been a passion for Sreehari. He utilized his opportunities to participate and win in numerous inter-collegiate musical competitions. His father Mr. A Narayanan Nampoothiri (Recognized Carnatic singer for over 30 years) stands as his all-time guru. In 2006 Sreehari made his first album \\\"Ninmizhi Ariyathey\\\". He teamed up with his friends in Technopark for the album \\\"Voice of the park\\\" in which he also sang a song. Sreehari through his melodious voice has given life to a few devotional albums as well. He has sung for a musical album which also includes the likes of MG Sreekumar. He has also done a solo for an album distributed by East coast which will be released shortly. Driven by his passion for music, he finds time to sing for a musical club in Trivandrum. He currently works with India\\\'s one of the major IT Companies in Tehnopark. His family consists of his better half Smitha and his son Mahadev. \r\n<br><br>\r\n\r\n<b>Vinod Kumar IR </b><br>\r\n\r\nVinod lives, dreams and breaths music.  A digital 2D animation artist by profession, Vinod always had a penchant for music and got trained under many coveted musicians in the industry. He has excelled as a professional singer for the past 15 years and has sung in 4 devotional albums with the likes of MG Sreekumar, P Jayachandran and Biju Narayanan. He has been associated with many professional troupes over the years and maintains an active role in organizing many musical events. He has been working as a Compositing artist with Toonz Animation for over 10 years. His family consists of his wife Hema G Nair and his son Gokul Krishnan who has already started following the footsteps of his father. \r\n\r\n                       <br></td>\r\n</tr>\r\n</table>\r\n<br> <br><div class=\\\"singer-row-container\\\">\r\n							<div class=\\\"singer-single-column\\\">\r\n                            	<div class=\\\"singer-image\\\"><img src=\\\"../images/singers/singer-anandv.png\\\" width=\\\"139\\\" height=\\\"111\\\" /></div>\r\n                                <div class=\\\"singer-details\\\">\r\n                                	<span class=\\\"singer-name-txt\\\">Anand Venkitaraman</span><br />\r\n                                    <span class=\\\"singer-designation\\\">Associate Consultant</span><br />\r\n                                    <span class=\\\"singer-company\\\">IBS Software Services</span>\r\n                                </div>\r\n                                <div class=\\\"clear\\\"></div>\r\n                          </div>\r\n                       	  <div class=\\\"singer-single-column2\\\">\r\n                            	<div class=\\\"singer-image\\\"><img src=\\\"../images/singers/singer-anisha.png\\\" width=\\\"139\\\" height=\\\"111\\\" /></div>\r\n                                <div class=\\\"singer-details\\\">\r\n                                	<span class=\\\"singer-name-txt\\\">Anisha M.H</span><br />\r\n                                    <span class=\\\"singer-designation\\\">Senior Medical Coder</span><br />\r\n                                    <span class=\\\"singer-company\\\">Revenuemed India</span>\r\n                                </div>\r\n                                <div class=\\\"clear\\\"></div>\r\n                          </div>\r\n						  <div class=\\\"clear\\\"></div>\r\n                      