(16, NULL, 'Koodiyattom Workshop and Performance', 'koodiyattom-performance-technopark', 'The phenomenal response to the Kathakali performance has inspired NATANA to introduce to the Techie cultural crowd, one of the most ancient, performing art forms of world- Koodiyattom.  Koodiyattom, which literally means acting together, is a dramatic representation in Sanskrit, mostly of Hindu mythologies. This art form used to be much in vogue in the temples of Kerala and most temples had a huge theater / stage called the Koothambalam where regular performances of Koodiyattom took place. Role playing in Koodiyattom includes stylized form of vocal recitation coupled with a complete hand-gesture language and highly evocative facial expressions. <br><br>\r\nThe workshop covers areas of acting through Mudras, gestures and body movements (ilakiyattom and Pakarnattom), the Navarasas (9 expressions), different types of dance movements and an introduction to Ahaarya (Costume and Makeup) along with Aniyara Parichayam (Green Room).  This will be followed by a Koodiyattom performance.  <br><br>\r\n<b>Program Schedule  </b><br><br>\r\n<b><span class=\\\"reg_header\\\">Koodiyattom Workshop and Jatayuvadhangam Koodiyattom  </span></b> <br><br>\r\n\r\n<b>5.00 PM to 6.00 PM </b> <br>\r\n\r\nKoodiyattom workshop <br><br>\r\nLead by Guru Kalamandalam Girija Devi & Kalamandalam Kanaka Kumar <br>\r\nConceptualized by: <b><span class=\\\"reg_header\\\">Harikrishnan Krishnakumar</span></b><br> [Tripunithura Hari Krishnan, the Secretary of Mrunmaya who works as a Senior Process Associate with Allianz Technopark is a trained artist himself. With his passion towards rhythms and eastern percussion ensembles he handles the \\\"Talking Drum of Kerala\\\" - Edakka with ace. He is currently researching in the \\\"Thaala concepts\\\" of South Indian percussion.] <br><br>\r\n\r\n<b>6.30 PM to 8.00 PM</b> <br>\r\nJatayuvadhangam Koodiyattom<br><br>\r\n\r\nRavanan - Sri .Kalamandalam Raveendran<br>\r\nJatayu - Sri Kalamandalam Kanaka Kumar<br>\r\nSeetha - Kumari. Kalamandalam Vijitha<br>\r\nSoothan - Sri. Kalamandalm Sohan<br>\r\nMizhavu - Sri. Kalamandalam Ramanunni<br>\r\nSri. Kalamandalam Sajikumar<br>\r\nEdakka - Sri. Harikrishnan K<br>\r\nThalam - Guru Kalamandalam Girija Devi<br>\r\nChutti and Aniyara - Sri. Kalamandalam Nikhil<br>\r\nSri. Kalamandalam Ramith<br>\r\nSri. Margi Sreejith \r\n<br><br>\r\n\r\n<b>Official Partners:</b><br><br>\r\n<table border=\\\"0\\\" cellspacing=\\\"0\\\" cellpadding=\\\"0\\\">\r\n<tr><td width=\\\"160\\\"><a href=\\\"http://www.airtel.in/\\\" target=\\\"_blank\\\"><img src=\\\"http://natana.in/upload/1338203812_AIRTEL_F5_RGB_3D.jpg\\\" border=\\\"0\\\" width=\\\"140\\\"></a>\r\n</td>\r\n<td width=\\\"150\\\">\r\n<a href=\\\"http://www.big927fm.com/\\\" target=\\\"_blank\\\"><img src=\\\"http://www.big927fm.com/images/logo.png\\\" border=\\\"0\\\"></a>\r\n</td>\r\n</tr>\r\n</table><br><br>\r\n\r\n<img src=\\\"../koodiyattom_web.jpg\\\" width=700>', 'Conceptualized by: Harikrishnan Krishnakumar [Allianz Technopark] ', '', 'thumbs/', '', '2012-05-31', 17, 0, 'Travancore Hall - Technopark', 1, 1),
(17, NULL, 'Film Club Inauguration', 'film-club-inauguration-by-amal-neerad', '<b>NAKSHATRA</b>, the film club of NATANA will be formally launched on <b>21st of June </b>at Technopark by noted film Director, <b>Amal Neerad</b>. The launch will be followed by screening of the short film \\\'AMAYA\\\' directed by <b>Nishanth Nazim</b> of Kreara Solutions, Technopark and a short documentary on the history of Cinema. \r\n<br><br>\r\n<img src=\\\'../NAKSHATRA.jpg\\\' width=\\\'400\\\'><br><br>', 'Technopark', '', 'thumbs/', '', '2012-06-21', 18, 30, 'Travancore Hall', 1, 1),
(18, NULL, 'Meet the Masters', 'meet-the-masters-arun-kumar-aravind', 'NAKSHATRA, the film club of Natana, welcomes you to the first \\\'Meet the Masters\\\' session. Meet the Masters series aims to provide a platform for all the film buffs of Technopark to interact, discuss and learn from the masters of the film industry.<br><br><br> \r\nThe first in line of the series is an interaction with <B>Mr. Arun Kumar Aravind</b> who is an award winning editor with credentials including \\\'Cocktail\\\', \\\'Vettam\\\', \\\'Kancheevaram\\\' etc. The 2 hour long session is scheduled on <b>9th of Augus</b>t starting from <b>6.30 PM at the Travancore Hall, Technopark</b>. We all sincerely request your support by participating in this session and take the vision of NAKSHATRA forward. <br>Look forward to seeing you all soon. \r\n<br><br><br> \r\n\r\n<img src=\\\'http://www.natana.in/admin/NewsLetter-01.jpg\\\'>', 'Technopark', '', 'thumbs/', '', '2012-08-09', 18, 30, ' Travancore Hall', 1, 1),
(19, NULL, 'Moly Aunty Talks - A talk show with Revathy', 'moly-aunty-talks-with-actress-revathy', 'Molly Aunty Rocks! portrays the character of Molly, a brave and bold woman, who will do only what she feels is right. <br><br>\r\n \r\nBut will Molly aunty rock or not ?<br><br>\r\n \r\nNow it\\\'s your time for the techies to see and chat with the real Molly, Revathy. <br><br>\r\n \r\nNatana presents Molly aunty talks a talk show with Revathy and the people behind the film on 21st Friday, Travancore Hall, Technopark @ 6:30 PM\r\n<br><br><br>', 'Technopark', '', 'thumbs/', '', '2012-09-21', 18, 30, 'Travancore Hall, Technopark', 1, 1),
