(22, NULL, 'Club Eventa', 'club-eventa', 'call 9747290422 / 9142047878 for tickets<br><br>\r\n\r\n<img src=\\\'http://www.natana.in/club-eventa.jpg\\\' width=700>', 'Club House, Technopark', '', 'thumbs/', '', '2013-02-14', 18, 0, 'Club House', 1, 1),
(23, NULL, 'Prayaan - painting Exhibition', 'prayan-painting-exhibition', 'An exciting week awaits all of us at Museum Auditorium, from 1st to 5th March. <br>\r\nSanthosh Kumar, a self taught artist with over two decades of experience is here with his first ever exhibition \\\'Prayaan\\\'. <br>\r\nDo visit and get your mind refreshed.<br><br>\r\nTime: 10 am to 7 pm\r\n<br><br>\r\n<img src=\\\"http://www.natana.in/natana-painting-exhibition.jpg\\\"><br></br>', '1st - 5th March', '', 'thumbs/', '', '2013-03-01', 17, 0, 'Trivandrum Museum Auditorium', 1, 2),
(24, NULL, 'Meet the Leaders | Dr Shashi Tharoor', 'meet-the-leaders-Shashi-Tharoor', '<B>\\\'Meet the Leaders\\\'</B> initiative intends to bring to Technopark, people who are likely to be key influencers in our fraternity. The first in the series will have <B>Dr Shashi Tharoor</B> interacting with our employees on Monday, 13th January at 5.30 pm. The venue is Technopark Open Air Amphitheatre. \r\n\r\n<br> <br><img src=\\\"http://www.natana.in/admin/Meet-The-Leaders-Dr-Sashi-Tharoor.jpg\\\" width=600>\r\n<br><br>', 'Technopark', '', 'thumbs/', '', '2014-01-13', 17, 30, 'Amphitheatre', 1, 1),
(25, NULL, 'Workshop on Participative Film Making', 'workshop-participative-film-making-Chayiliam', 'A workshop and interactive session on \\\"Participative Film Making\\\" as promoted by the makers of the critically acclaimed movie - Chayiliam! The movie had bagged quite a few prestigious awards both in India and abroad (including IFFK and the Kerala State award). It is the 2nd crowd-funded film in Malayalam (after John Abraham\\\'s \\\"Amma Ariyaan\\\"), with over 2000 producers and an effort spanning over 5 years! This interactive session shall provide a platform to interact with <b>Manoj Kana</b> - the director,<b> Anu Mol </b> - the lead actress and many others to share their experience on the participative film making model and the challenges they had to face. The movie is scheduled to hit the theatres early next week.<br><br>\r\n \r\n<img src =\\\"http://www.natana.in/chaiyiliam_flyer.jpg\\\" width=600>', 'Technopark', '', 'thumbs/', '', '2014-01-22', 18, 0, 'Travancore Hall, Park Centre', 1, 1),
(26, NULL, 'Kids Fest 2014', 'kids-fest-toonz-technopark', '\\\'Kids Fest 2014\\\' organised by Toonz Animation in association with NATANA on <b>15th of February @the Exhibition Hall, Park Centre, Technopark from 8.30 AM to 1.00 PM</b>. <br><br>Open only to the kids (4yrs to 14 yrs) of Technopark employees, the event aims at proving a learning experience to your kids while having fun with animation, illusion and creative images. The sessions will be handled by renowned animation expert Prosenjith Ganguly and Raja Moorthy, an international award winning entertainer. \r\n<br><br>\r\nYou can register for the event < <A href=\\\"http://www.toonz.co/registration.html\\\" target =\\\"_blank\\\">http://www.toonz.co/registration.html</a> > for free and confirm your participation. <br><br><br>\r\n\r\n<b>Last date of registration is 10th of February 2014</b>\r\n<br><br><br>\r\n<img src=\\\"http://www.natana.in/Kids-Fest-2014.jpg\\\" width=600>', 'Technopark', '', 'thumbs/', '', '2014-02-06', 8, 30, 'Exhibition Hall, Park Centre', 1, 1),
(27, NULL, 'One-day Theatre Workshop ', 'one-day-theatre-workshop-technopark', 'NATANA in association with DIVINE COMEDY is organising a one-day theatre workshop in Technopark on 1st of March 2014, at the Technopark Club House from 9.30 am to 4.30 pm. <br><br><br>\r\n \r\nThe session will be handled by <b>Manoj Nair</b> who has an extensive work history with London West End Theatre Circuit and also production houses such as ITV, BBC etc. He is also a visiting lecturer at London College of Music and Examiner for London Academy of Music & Dramatic Arts. He will be supported by <b>Siddharth Nair</b> (Producer/VJ - Rosebowl) and <b>Abhinav Kumar</b> (Copywriter/Stage Artist). The workshop will focus on areas like Acting, Communication, Voice Over, Posture, Text Analysis & Spatial Awareness.\r\n <br><br><br>\r\nRegistration is free and seats are limited to 20. For confirmation please email <b>divinecomedy@live.com</b> on or before <b>28th of February 2014.</b> <br>\r\nFor details on the workshop please contact <b>Kevin (9288904703)</b>, attached further details about the workshop. <br><br>\r\n \r\n\r\n<img src=\\\"http://www.natana.in/Theatre_workshop_NATANA.jpg\\\" width=620>\r\n', 'Technopark', '', 'thumbs/', '', '2014-03-01', 9, 30, 'Tulip Hall, Technopark Club House', 1, 1),
(28, NULL, 'Guitar workshop by Santhosh Chandran', 'guitar-workshop-by-santhosh-chandran', 'Exclusive Two Day Guitar Workshop by Santhosh Chandran <br><br>\r\n \r\n* Warm-up exercises & Technical development<br>\r\n* Scales & Modes<br>\r\n* Intro to Jazz<br>\r\n* Lessons on own compositions<br>\r\n* Jam session improvisation and trading<br><br>\r\n\r\nLevel: Beginner <br><br>\r\n\r\nParticipants are requested to bring their own Acoustic Guitar <br><br>\r\n\r\nProgram Fee: 500 INR / DAY <br><br>\r\n\r\n\r\n<br><br><a href=\\\"http://www.natana.in/guitar-workshop-registration\\\">please click here to register</a><br><br><br>\r\n<img src =\\\"http://www.natana.in/SC_guitarworkshopTVM.jpg\\\" width =\\\"680\\\">\r\n', 'Technopark', '', 'thumbs/', '', '2014-07-05', 9, 0, 'Club House', 1, 1),
(29, NULL, 'Technopark Premiere of CORPORATE ', 'technopark-premiere-of-movie-corporatete', 'The Technopark Premiere of the much-awaited 42 minutes film <b>Corporate</b>, directed by <B>Nishant Pillai (Suntech)</B> will be held on <B>10th July 2014, 6.00 PM@ Travancore Hall, Technopark.</B> \r\nThe cast include fellow Techies <B>Ajit Kumar (Q Burst)</B>, <B>Divya Chandran (Infosys)</B>, <B>Varun Chandran (Speridian)</B> and <B>Sreekutty K Nair (IBS)</B> along with other prominent actors from Mollywood. \r\nThe film touted as a \\\"Techno Thriller\\\", throws light on the consequences each of us would have to face if we are negligent with the use of technology, and the manipulations and power war that happens in the corporate world.<br><br><br>\r\n \r\nMore details and trailer @ <a href=\\\"https://www.facebook.com/Natanatheclub\\\">https://www.facebook.com/Natanatheclub</a>  <br><br>\r\n \r\nBe there to catch them in action and support their venture. <br><br>\r\n\r\nENTRY FREE!!<br><br>\r\n\r\n<img src=\\\"http://www.natana.in/corporate.jpg\\\" width = 700><br><br>', 'Technopark', '', 'thumbs/', '', '2014-07-10', 18, 0, 'Travancore Hall, Park Center', 1, 1),
(30, NULL, 'Jalwa Dance Competition ', 'jalwa-dance-competition', 'Jalwa Dance competition', 'Technopark', '', 'thumbs/', '', '2014-08-27', 18, 30, 'Amphitheater ', 1, 1),
(31, NULL, 'Thaikudam Bridge Performance', 'thaikudam-bridge-technopark-live', 'For the First time in Technopark', 'Technopark', '', 'thumbs/', '', '2014-08-28', 18, 30, 'Amphitheater ', 1, 1),
(32, NULL, 'CELESTE', 'CELESTE', 'NATANA, in association with BEST MATRIMONY ONLINE, presents CELESTE, a potpourri of competitions and events to enthral the Technopark community from 26-28 August, 2014 at Bhavani Atrium, Technopark. <br><br>\r\n\r\nThe most prestigious among the array of competitions arranged is the crowning of the best <b>\\\"Young & Eligible\\\"</b> and the <b>\\\"Best Couple\\\"</b> from the Park. Register and ensure your seats to be the most sought after single or the couple that would make the entire park envious!<br><br>\r\n\r\n<a href=\\\"http://www.natana.in/young-and-eligible-contest-registration\\\">Click here to register for \\\'Young & Eligible\\\' Contes</a>t<br><br>\r\n\r\n<a href=\\\"http://www.natana.in/best-couple-contest-registration\\\">Click here to register for \\\'Best Couple\\\' Contest</a><br><br>', '26-28 August, 2014', '', 'thumbs/', '', '2014-08-26', 9, 0, 'Bhavani Atrium, Technopark', 1, 1);
