(447, 10, '2013-10-04', 'ezjipspoa', 'ezjipspoa', 'musictzsx@hotmail.com', 'The speed of communication increases each year, at a momentum that will grow faster as the world moves into the future. Once upon a time, a military installation commander could rest on his or her communication laurels once regular staff meetings were established, a base newspaper was published and distributed, and bulletin boards for displaying flyers were set up around the installation.But no more. The world has changed and people have greater expectations. People frequently want information right now. The communication revolution has been taking place for many years, with YPG establishing its first external website way back in the 1990s. For many years, maintaining the external YPG website (www.yuma.army.mil), in addition to the proving ground\\\'s other communication efforts, proved to work out fine. As a matter of fact, the popular website is being revamped right now and will be released soon in a cleaner, more informative way, organized around the Army\\\'s standard website template. It will be better than any previous YPG website, but is far from the end of YPG\\\'s public communication plan.In April of last year, YPG established an official Yuma Proving Ground Facebook site (www.facebook.com/USAYPG) that has garnered nearly 675 likes from the public. The site incorporates hundreds of photographs and is updated several times each week. Feedback has been positive and real efforts have been devoted to make sure the Facebook site\\\'s contents remain current and interesting.In recent months, YPG has moved further into the social media world by establishing sites on YouTube, LinkedIn and Twitter. YouTube, as many know, is a repository for videos of all types, from old television programs and music videos to newly produced productions of all types, some by amateurs and some by professionals. YPG\\\'s YouTube site (www.youtube.com/yumaprovingground) consists of 11 assorted videos any member of the public may view, free of charge, at any time. Included are overviews on each of the YPG test centers, test program videos showing explosions, NASA parachute drops, and digitized versions of vintage command briefings.Twitter is an excellent communication tool that limits messages to no more than 140 characters. This means written statements, called tweets, have to be condensed and to the point. During times of emergency, this is a great way of sharing breaking information with people using a computer or smart phone. The YPG Twitter site is located at: www.twitter.com/ypg_az.Many people involved in the social media world particularly enjoy LinkedIn because it is business-oriented and straightforward, without the bright colors and flash of Facebook. YPG\\\'s LinkedIn site (www.linkedin/company/us-army-yuma-proving-ground) calmly describes the features of Yuma Test Center, Cold Regions Test Center and the Tropic Regions Test Center, with the hope of igniting the interest of future customers.Looking over past decades, observers know the communications world has never been static. Newspapers were once printed on clunky printing presses and each page was manually designed and typeset. All photographs once were taken on 35mm or 120 format film. Today, newspapers are designed on a computer and photographs are invariably digital.Many readers still prefer to receive their news by hardcopy and it\\\'s a need that will continue to be filled by Yuma Proving Ground\\\'s newspaper, the Outpost. With a large and diverse readership spread over 1,300 square miles of land, many without computer access, YPG\\\'s commitment to the Outpost remains strong.The communications world will continue to evolve and YPG\\\'s communications efforts will evolve with it. The proving ground is fully committed to its social media efforts, with new ones in the future, in a conscientious, pro-active manner that shares information and exciting photography with the over 2,500 YPG employees, but also people in Southwest Arizona and around the globe.Chuck Wullenjohn is the public affairs officer for Yuma Proving Ground. He can be reached at .\r\n hoganoutletccsj\r\n Hunt stresses that he s just tossing this out there, not representing the school board or district or anything. And, of course, there s always the subject we just hate to talk about: Money!\r\n tbqd longchampoutletccsj\r\n Free Run Outlet, Cheap Free Run Shoes Online Sale 60%OFF\r\n rernv louis vuitton borse\r\n aiemd prada handbags\r\n Pope Francis\\\' recent comments suggesting he would not judge priests simply because they have a homosexual orientation reflect a more compassionate tone, not a change in doctrine, Murphy said.\r\n \r\nLouis Vuitton Outlet, Louis Vuitton Handbags, Louis Vuitton Sale, Your Best Choose!\r\nnike air max\r\n isbzj Wholesale fake balenciaga purses, balenciaga bags, wallet, Designer Handbags\r\n ccfqmktkx Cheap True Religion Jeans For Cheap Outlet Online Discount - True Religion Jeans Outlet\r\n If Obama doesn\\\'t want to use military strikes, he must revisit the issue of arming more moderate rebels. Otherwise Syria is headed for a division between a rump Assad state and so-called emirates run by well-armed radical Islamists who have squelched moderates with fewer weapons. Refugee flows will continue to flood Lebanon, Jordan, Turkey, and Iraq.\r\n  michael kors\r\n \r\nRelated topics: \r\n', 0),
