INSERT INTO `tab_news` (`news_id`, `project_id`, `news_title`, `page_name`, `news_description`, `news_image`, `news_thumb_image`, `news_date`, `news_publish`, `news_priority`) VALUES
(4, NULL, 'Meet on \'Natana\' held ', 'meet-on-natana-held-at-technopark', 'As a prelude to the launch of \\\'Natana\\\', the cultural club of Technopark, the Group of Technology Companies (GTech) has organised a resource meeting. The meeting brought together around 200 talents from various companies in Technopark. Film director Shyamaprasad and artistic director of IFFK Bina Paul Venugopal were the chief guests. <br /><br /> The grand launch of Natana is scheduled to be held in March. Natana will serve as a platform to create an enabling environment for the IT professionals in Technopark to nurture their artistic talents and creative aspirations. The objective of the club is to bring together professionals from the Technopark community who are keen to pursue their interests in culture, music, films, dance and other forms of traditional arts.<br /><br /> \\\"Art is an end in itself. Other than fulfilling your dreams, it helps in personal and community development,\\\" Shyamaprasad said. He also urged the Technopark community to take Natana towards perfection so that it can be a sustainable professional club for aspiring creative talents.  Bina Paul expressed the hope that Natana would help bridge the gap between the modern Thiruvananthapuram which consists of the young aspiring crowd and the traditional Thiruvananthapuram with its rich heritage of cultural expressions and exchanges. <br /><br /> Technopark CEO Mervin Alexander, president of GTech V K Mathews and GTech secretary Anoop Ambika spoke at the function.<br /><br />\r\n<span class=\\\"talent_link_text\\\"><a  class=\\\"talent_link_text\\\" href=\\\"http://expressbuzz.com/cities/thiruvananthapuram/meet-on-%E2%80%98natana%E2%80%99-held/244741.html\\\" target=\\\"_blank\\\">http://expressbuzz.com</a></span>', '', 'thumbs/', '2011-02-03', 1, 1),
(5, NULL, 'NATANA - in news', 'natana-in-news', 'Don\\\'t be surprised if you hear a song, the tinkling of anklets or high-pitched drama dialogues on entering the Technopark campus. Emphasising its tagline \\\'harmony@work\\\', one of the largest IT parks in the country is all set for an employee-friendly makeover. Technopark is launching a fine arts club - \\\'Natana\\\', which will offer the best platform to nurture and express one\\\'s talent.<br><br>\r\nIt\\\'s time for techies to escape the strain of project deadlines and enjoy an opportunity to brush up and showcase their talents, which might once have been a part of their eventful school or college days. Those keen to get training in any art form for the first time too can cheer up. With the support of Group of Technology companies (GTech) - a strategic grouping of IT/ITES enterprises in Kerala, Natana will be launched at a star-studded, gala event on January 20.<br><br>\r\nAnoop P Ambika, secretary of GTech and CEO of the Technopark-based Kreara Solutions, is the torchbearer of the new initiative. Anoop was instrumental in taking such a novel idea to the discussion forum of GTech. \\\'The objective of the club is to bring together professionals from the community who are keen to pursue their interests in culture, music, films, dance and other forms of arts. Top officials of all the companies have welcomed the employee-engagement programme. The employees are eagerly waiting for its launch, which is planned on January 20. So far, around 350 employees have registered their names,\\\' Anoop said.<br><br>\r\nElaborating on the process of setting up the club, Anoop said, \\\'We are in the process of identifying talents to create a talent pool. For that, a core committee consisting of two representatives from each company has been constituted. This core committee is led by some employees, including Deepa Rahul and Rakesh, who are known to television viewers.\\\'<br><br>\r\nThe members of the talent pool will be segregated based on their interest. The club will have association with professional organisations, which are expected to conduct grooming sessions. All interested employees will be brought to a single platform with the launch of Natana. Performance of a professional group, a known talent of Technopark and a new member of Natana, will mark the event launch.<br><br>\r\nEnquiries are pouring in. Employees are keen to know about the activities of the club, some want to know about training and some even enquire on facilities to learn new art forms. The website of Natana, which enables employees to fill a column I can\\\', is already flooded with messages of wannabe artists.<br>\r\nOrganisers of Natana have published a list of talents they are looking for. It includes dancers (classical and western), singers (English/India), musical instruments (traditional/ fusion), acrobats, mimicry, traditional fine arts (Thottam, Theyyam etc), content writers, art directors, actors/mime artists, film buffs, DJs, magicians, speakers, aspiring models and fashion/dress designers. Natana plans to give help to ailing artists in the future.<br><br>\r\nTime is the only challenge in front of the organisers. \\\'Though the employees work for 8-10 hours a day, only 6-7 hours could be considered as very productive. The rest of the time goes for browsing, discussions and other engagements. Natana is planning to make use of this time,\\\' the organisers said.\r\nNatana is expected to turn out as the best New Year gift for the techies.<br><br>\r\n\r\nSource: Technopark Today / The New Indian Express\r\n\r\n', 'upload/1297419569_1.jpg', 'thumbs/upload/1297419569_1.jpg', '2010-11-25', 1, 2),
(6, NULL, 'Tagline contest for NATANA - The Arts Club of Technopark', 'tagline-contest-for-natana-the-arts-club-of-technopark', 'The fine arts club of Technopark, NATANA, calls for entries to the tagline contest and the theme contest. The official website of NATANA, http://www.natana.in/ invites everyone to contribute to the contest to pick the best tagline. The winner will walk home with  exiting prizes.\r\n\r\nAlso, NATANA invites all to suggest a theme for the launch of NATANA on January 20th 2011. Take a look at http://www.natana.in/ThemeforNatana.aspx to give your suggestions for the theme. The lucky winner gets prizes for his/her creative and exceptional idea !\r\n\r\nWhat are you waiting? It\\\'s time to brush up the artist in you. Give vent to  your imagination and let\\\'s give NATANA a great name and a grand opening.\r\n', '', 'thumbs/', '2011-01-01', 1, 3),
(7, NULL, 'Techies take up creative pursuits', 'technopark-natana-launch-by-prithviraj-and-avial-live-concert', 'Information Technology (IT) professionals on the Technopark campus here will soon have an opportunity to prove that life is not all about wrestling with the complexities of digital technology. <br/><br/>\r\n\r\nThose with a yen for arts and culture can use their after-office hours to indulge in their favourite creative pursuit, thanks to a novel initiative launched by Technopark, in association with the Group of Technology Companies (GTech), a strategic grouping of IT/ ITeS enterprises in the State. <br/><br/>\r\n\r\nOn April 7, the campus will witness the inauguration of an arts and culture club named Natana. The club will serve as a platform to create an enabling environment for IT professionals to nurture their creative aspirations. The club also aims at facilitating partnerships with cultural organisations locally, nationally and internationally for cultural exchange programmes and to organise regular cultural evenings, film festivals and musicals for the Technopark community. \r\n<br/><br/>\r\nActor Prithviraj is scheduled to inaugurate the club at the amphitheatre on the campus on April 7. The function will be followed by a music programme by professional band Avial and a cultural collage by employees of various firms at Technopark. \r\n<br/><br/>\r\n\\\'The entire event will be managed by representatives of the Natana Club with no professional assistance. Right from script writing to choreography, direction and stage management, everything will be handled by the IT professionals themselves. All this after office hours and on weekends,\\\' Sundari Giri, senior manager, Operations, M Squared Software and Services Pvt. Ltd., said. \r\n<br/><br/>\r\n<span class=\\\"talent_link_text\\\"><a href=\\\"http://www.thehindu.com/todays-paper/tp-national/tp-kerala/article1586876.ece?sms_ss=facebook&at_xt=4d9416e7a320e89b,0\\\" target=\\\"_blank\\\">www.thehindu.com</a></span>', '', 'thumbs/', '2011-04-06', 1, 1),
(8, NULL, 'The great launch', 'technopark-cultural-club-natana-launched', 'Finally, The Dreams of thousands of Techies in Technopark became True. The Mega launch of the greatest platform for  the arts in Technopark happened yesterday evening, inaugurated by the youth icon Prithviraj.<br><br>\r\n \r\nIn the colorful occasion with Dances, Skits, Fashion Shows and enthralled audience, The launch of NATANA was the biggest event ever happened in the history of Technopark!<br><br>\r\n \r\nThe Attraction of the event was Pritviraj. Audience were really excited to see him, and he answered for a couple of casual and curious questions from Techies, including his marriage.<br><br>\r\n \r\nIn the vote of thanks speech, Anoop Ambika - the key personality behind this initiative told \\\'we started this with a simple concept to conduct an art film festival in technopark. But when we discussed it with people, it became a great concept of NATANA - the biggest Arts platform for Techies\\\'. He remembered and thanked each and every contributors, supporters, well wishers and each and every person who made this happen.<br><br>\r\n \r\nafter that, the unique malayalam rock band - AVIAL performed in stage. What an astonishing and terrific show! They made everyone dance.. It was really a great evening for Technopark.\r\n<br><br>\r\n\r\n<a href=\\\"http://www.natana.in/gallery-natana/9\\\"  class=\\\"talent_link_text\\\">View Gallery</a>', 'upload/1305916151_IMG_3841.jpg', 'thumbs/upload/1305916151_IMG_3841.jpg', '2011-04-08', 1, 1),
(9, NULL, 'Techies tune to Kalyanasaugandhikam ', 'technoprk-natana-kathakli-nite', 'On the evening of  16th July, Travancore hall in park center , roared with applauds as Bhima , Hanuman and rest of the performers descended the stage. <br><br> \r\n\r\nSethu from IBS was the star of the evening as the art form he holds close to his heart; left a 300 odd techie audience spell-bound. The reaction from the crowd was unanimous - Brilliant! A large section of the audience was people who were watching Kathakali for the first time and all of them started loving the traditional dance-drama. \r\n<br><br>\r\nSethu says \\\"It was my dream to perform in front of my colleagues and Natana made my dream real. For sure, its a long journey and this is just the beginning.\\\"\r\n<br><br>\r\nNATANA now has moved from fashion shows and western dances to Kathakali. Where next? Stay tuned for updates. \r\n\r\n<br><br>\r\nWe\\\'ve got a gallery of images for those who missed the event and for those who want to ponder over that nostalgic evening again - \r\n<br><br>\r\n<a href=\\\'http://www.natana.in/gallery-natana/10\\\' style=\\\"text-decoration: none;outline: none; color: #BBBBBB\\\"><span class=\\\"reg_header\\\">Gallery</span></a><br>\r\n<a href=\\\'http://bit.ly/jLajzK\\\' target=\\\'_blank\\\' style=\\\"text-decoration: none;outline: none; color: #BBBBBB\\\"><span class=\\\"reg_header\\\">Picasa gallery</span></a>\r\n\r\n<br><br>', 'upload/1308330866_IMG_4679.jpg', 'thumbs/upload/1308330866_IMG_4679.jpg', '2011-06-17', 1, 1),
(10, NULL, 'Talents galore at the NATANA Auditions', 'natana-music-audition-technopark', 'As the curtains were drawn for the biggest talent hunt in Technopark, on 15th of November at the Club house, an air of excitement, fun and camaraderie filled the atmosphere.  Despite their busy schedule, aspirants flocked in numbers to prove their mettle. The singing auditions had 80 vocal talents who competed neck-to-neck giving a hard time to the judges. And in the end we have a talent pool of gifted vocalists who are all set to make us sway to their tunes, soon. <br> <br>\r\nThe audition for musical instruments on 19th November was equally exciting and inspiring. On offer was a brilliant display of accomplishment and mastership as talents took turns on a variety of instruments exhibiting their propensity with absolute professionalism. The quandary the judges had, picking the best, was apparent from their concluding remark -\\\"Why do you limit yourself to just one music band when you have talents for more?\\\"  <br> <br>NATANA has been thinking about setting up a music band of, for and by the techies of Technopark and thanks to the support from many quarters, we have progressed much towards that end. There was little doubt of what is in store, when the enthusiastic bunch of musicians volunteered for a jam session right after the audition. Exciting times await music aficionados in the tech community- Watch out! They are all set to rock us. \r\n <br> <br>', '', 'thumbs/', '2011-11-21', 1, 1),
(11, NULL, 'Nakshatradeepangal was special for Technopark', 'nakshatra-deepangal-musical-nite-technopark', 'The starry night of December 8, 2011 was special for Technopark. Nakshatradeepangal lived up to its expectations as 23 stars of Technopark joined hands and paid their tribute to the musical maestros M.G Radhakrishnan, Johnson Master and Girish Puthencheri. As they rendered the ever green songs of the  proverbial stars of Malayalam film music, a feeling that the stars virtually came down to earth embraced the audience. The occasion was blessed with Shri. Bichu Thirumala, Smt. Padmaja Radhakrishnan, wife of MG Radhakrishnan, Dr. Mervin Alexander, CEO of Technopark and Mr. V.K.Mathews, CEO of IBS and Chairman of GTech. The biggest attraction of the musical night was the upcoming play-back singers Sudhip and Akhila who joined the artists of Technopark on stage. <br><br>\r\nThe occasion also witnessed the launch and logo unveiling of NATANA\\\'s musical band \\\'NAADAM\\\'. A peppy fusion song marked the official launch of the band, making the full-house audience sway to their tunes. With this event, NATANA has brought forward the singing talents of Technopark together thus strengthening its resolve to provide a platform to nurture their passion.\r\n<br><br><br>', '', 'thumbs/', '2011-12-12', 1, 1),
(12, NULL, 'Techies to hone their dancing skills @ the Technopark Club House', 'dance-class-at-technopark-club-house', '<br><br>NATANA has joined hands with the city based professional dance school XTREAMERS to offer dance classes for the employees of Technopark. Training in Hip-Hop, Salsa and Western Free Style will be provided by experienced professionals for aspiring dancers and professionals who wish to hone their skills. NATANA\\\'s launch program last year saw a crowd of forty dancers drawn from Technopark putting in a stupendous performance capturing the audience.  This provides an excellent platform for such enthusiasts from the Technopark community to enhance their skills and follow their passion.  \r\n<br><br>\r\nFees: 1100 Rs<br>\r\nVenue: Club House, Technopark<br><br>\r\n<a href=\\\"../dance-class-registration\\\"  class=\\\"talent_link_text\\\" ><span class=\\\"reg_header\\\" style=\\\"text-decoration:underline;\\\">Click here to register</span> \r\n\r\n<br><br>\r\n<img src=\\\"../dance poster.jpg\\\" border=\\\"0\\\">\r\n</a>\r\n\r\n<br><br>\r\n\r\n', '', 'thumbs/', '2012-04-25', 1, 1),
(13, NULL, 'A star in the horizon for the film buffs in Technopark', 'film-club-inauguration', 'NAKSHATRA, the film club of NATANA will be formally launched on 21st of June at Technopark by noted film Director, Amal Neerad. The film club aims to bring together like-minds in various areas of film making inclusive of art, craft and technology. The film club has already attracted massive response with over 200 employees from various companies inside Technopark registering as active members. As part of the activities, film appreciation sessions, art and technical workshops, film screenings, short film competitions, film festivals etc. are on the anvil of the club. The launch will be followed by screening of the short film \\\'AMAYA\\\' directed by Nishanth Nazim of Kreara Solutions, Technopark and a short documentary on the history of Cinema. <br><br><br>\r\n\r\nVenue: Travancore Hall, Technopark <br>\r\nTime: 6.00 PM \r\n<br><br><br>', '', 'thumbs/', '2012-06-19', 1, 1);
