(157, 'AUDITIONS FOR NATANA BAND', 'Rock your head... tune in to the beats... For, it\\\'s time for a musical extravaganza from the Natana family! &lt;br&gt;&lt;br&gt;\r\n\r\nNATANA is planning to launch a Music Band early next year. We invite all talented singers and instrumentalists (all genre) within the park for an audition that will be conducted on the 15th and 19th of November 2011 at the Technopark Club house. &lt;br&gt;&lt;br&gt;\r\n\r\n&lt;b&gt;DETAILS&lt;/b&gt;&lt;br&gt;&lt;br&gt;\r\n\r\nSinging &lt;br&gt;&lt;br&gt;  \r\nPerformance Time :3 minutes for a Participant &lt;br&gt;&lt;br&gt;\r\nRules &lt;br&gt;\r\n1.   Contestants can opt to sing in any language / genre ( eastern/western category). &lt;br&gt;\r\n2.   Only solo performances shall be considered as part of the auditions. Please note that no accompanying instruments or karaoke will be allowed. &lt;br&gt; \r\n3.   Contestants must be prepared to sing additional songs of a different genre if requested by the judging panel.  &lt;br&gt;\r\n4.   Contestants shall be rated based on their Vocal Ability (rhythm/pitch/phrasing) and Stage Presence (confidence) among other factors as felt apt by the judging panel.  &lt;br&gt;\r\n5.   All decisions of the judging panel in association with the organizing committee shall be final.  &lt;br&gt;&lt;br&gt;\r\n  \r\nInstrumental   &lt;br&gt;&lt;br&gt;\r\nRules &lt;br&gt;\r\n1.   All solo performers must meet the minimum and maximum time allotment. &lt;br&gt;\r\n2.   Minimum time for each performance is 3 minutes and the maximum time is 10 minutes.  &lt;br&gt;\r\n3.   A (0.1) point penalty per 5 seconds less than the minimum or per 5 seconds over the maximum will be assessed to the final score of that performer. &lt;br&gt;\r\n4.   No equipment is allowed that could damage any part of the performance venue or that is distasteful or obscene. &lt;br&gt;\r\n5.   Performers are allowed to perform in more than one category. &lt;br&gt;\r\n6.   No instruments will be provided. All solo performers are required to provide their own instruments, sticks, and/or mallets. &lt;br&gt;\r\n7.   No accompanist are allowed. &lt;br&gt;\r\n8.   Extension chords , pics etc for guitars have to be brought by the participant. &lt;br&gt;&lt;br&gt;\r\n\r\n&lt;span class=\\&quot;footer_menu_text\\&quot; style=\\&quot;color:#b8262e;\\&quot;&gt;&lt;a href=\\&quot;http://www.natana.in/Audition-registration\\&quot; target=\\&quot;_blank\\&quot; style=\\&quot;text-decoration: none;outline: none; color:#b8262e;\\&quot;&gt;Click here to Register &lt;/a&gt;&lt;br&gt;&lt;br&gt;\r\n', '', ''),
