INSERT INTO `tab_talent` (`talent_id`, `talent_name`, `talent_prof`, `page_name`, `talent_description`, `talent_image`, `talent_image_sec`, `talent_month`, `talent_year`, `talent_priority`, `talent_publish`) VALUES
(3, 'Vinod Varma', 'Quality Control Supervisor, M-Squared ', 'vinod-varma', 'Vinod Varma has been associated with the music industry for the last 15 years. What began, as a fancy in his early life has remained his passion throughout. He started off professionally with a Rock Band named WRENZ as a guitarist, and then went solo and released an English album called ATMA in the late 90s. The song (Good Times) from that album was selected as one of the best 10 songs in India by the Rock Street Journal. He also worked on a fusion album with M.G. Sreekumar called Naadarupini.<br/><br/>He has had an international exposure - being a part of Deepak Dev\\\'s concert conducted in Dubai in the year 2006, and also in the Mega Event held in EKM where he has shared the stage with the evergreen heroes of music like Yesudas, Chitra etc.<br/><br/>He has been balancing his regular career as a Quality Control Supervisor in M-Squared and his music career equally well, and when he is not into albums, he keeps himself active singing jingles for many renowned companies, and to name a few, he has sung for Geepas, Kent Homes, National Builders, and Popy Nano.<br/><br/>His latest achievement has been the catchy song (Heyoo) that he sang for the Malayalam movie \\\'Tournament\\\', which has been composed and directed by Deepak Dev. This aspiring musician has more to give us in the times to come, and is currently working on a Hindi album with Deepak Dev. He is also into composing English songs.<br/><br/>A few of his songs can be heard at <span class=\\\"talent_link_text\\\"><a class=\\\"talent_link_text\\\" href=\\\"http://www.youtube.com/user/doniv73\\\"> www.youtube.com</a> and</span> <span class=\\\"talent_link_text\\\"><a class=\\\"talent_link_text\\\" href=\\\"http://www.esnips.com/web/doniv73-mysongs\\\">www.esnips.com</a>.</span>', 'upload/1297340378_talent_tv.jpg', 'upload/1297266553_talent_person.JPG', 2, 2011, 2, 1),
(4, 'Gayathri Govind', 'Nest - Software Engineer', 'technopark-maruthi-suzuki-talent-of-the-month-gayathri-govind', 'Gayathri Govind is twinkle-toed. In fact she proved she does not have two left feet in Asianet\\\'s \\\'Thakadhimi.\\\' The dancing lass is on seventh heaven having won the title and hefty prize money. <br><br>\r\n\r\nHaving started dancing from the age of three, Gayathri was always interested in learning various Indian dance forms. Bharatanatyam, Mohiniyattam, Kuchipudi, Ottanthullal, Kathakali, and Kathak.<br><br>\r\n\r\nGayathri\\\'s distinctive ability to express all shades of emotion with sensitivity and intuition can be seen in her recitals. She has a galaxy of inspiring Gurus guiding her through different dance forms.<br><br>\r\n\r\nGayathri had received several laurels at both the State and University youth festivals. Her performing career spanning over one and a half decades has taken her to various stages in India and abroad. She is planning to develop her career as a dancer as well as a research fellow.<br><br>\r\n\r\nGayathri completed her B.Tech. in Mar Baselios College of Engineering and Technology, and is currently working in NeST, Technopark as a Software Engineer. she is balancing her work along with the dance shows with the great support of her family. <br><br>\r\n\r\nMoreover she is very familiar to us as a TV anchor. She was the one who anchored the Kavita Reality Show Mambhazham in Kairali. She had done anchoring and dance shows for Asianet, Surya, ACV, Kairali, BTV, Kairali We and Doordarsan. She is a renowned choreographer and is leading a dance team Silver streak.<br><br>\r\nThe young danseuse love dancing and dance for the love of it.\r\n', 'upload/1300952550_talent_tv.jpg', 'upload/1300953131_gayasing3.jpg', 3, 2011, 1, 1),
(5, 'Sethunath Nair', 'IBS', 'technopark-talent-month-sethunath-ibs', '\\\"Stay deeply rooted while reaching for the sky<br>\r\nBe still long enough to hear your own leaves rustling\\\"- says the famous quote. And here is a man\r\nwho rooted himself deep into his own tradition, while reaching out for the infinities of Information\r\nTechnology- for Kathakali is his passion and despite belonging to the busy-round-the-clock-IT\r\ncommunity, he finds ample time to nurture his vehemence for this traditional art of Kerala. He is\r\nSethunath Nair, who presently heads the ASP Operations of IBS, though more popularly known among\r\nthe techies for his art. He has over 13 years of experience in the industry and has worked in Middle East\r\nand Singapore in various capacities specializing in Oracle and Database Administration.<br><br>\r\n\r\nSethu started learning Kathakali at the age of nine under reputed teachers including Kalamandalam\r\nSreekumar (Head of Kathakali, RLV College, Tripunithura). He performed professionally at different\r\ntemples and Kathakali clubs all over the state. Currently he is practicing under Kalamandalam Ratheesan\r\n(Principal, Margi).<br><br>\r\n\r\nMoreover, Sethu, a dedicated Kathakali artist, exploits the potential of technology and social networking\r\nin promoting Kathakali online, to save it from being sidelined in the scurried life of present day youth.\r\nHe opened up a group for Kathakali lovers in Facebook which rightly serves as a platform for a lot\r\nof creative initiatives and fruitful discussions on rejuvenating the art, besides contributing keenly to\r\nvarious online sites like kathakali.info. He is also a prolific blogger (nishkkalankan.blogspot.com) and an\r\nexcellent photographer.<br><br>\r\n\r\n\\\'Kathakali Night\\\' organized by Natana at Travancore Hall, Technopark was a platform where his colleagues and fellow\r\ntechies could witness the artist in him take its fullest profile. The romantic Bheema of Mahabharatha\r\nconquered the hearts of viewers on his way through jungles in search of Kalyanasaugandhikam for his\r\nlovely wife, Panchali. It was indeed a night when the techies discovered a Kathakali lover in themselves.<br><br>\r\n\r\nHailing from Alapuzha, he stays in Trivandrum with wife Vidya and daughter Madhuchandra.<br>\r\n<br>\r\n\r\n\r\n<a href=\\\'http://www.natana.in/gallery-natana/10\\\' style=\\\"text-decoration: none;outline: none; color: #BBBBBB\\\"><span class=\\\"reg_header\\\">Kathakali Night Gallery</span></a>', 'upload/1319182725_1319107391_talent_tv.jpg', 'upload/1319183178_sethu2.jpg', 10, 2011, 1, 1),
(6, 'Jayadevan ', 'Palnar Transmedia', 'jayadevan-palnar-technopark', '<br><br>A beaming guy, though lean, Jayadevan is apposite to be entitled \\\"<strong>NATANA Talent of the Month</strong>\\\" for his scale of fervor for music and traditional art. Zealous about singing right from the childhood, he was always on the victory stand whenever he partook in any competition. Chakiarkoothu, Kathakalisangeetham and recitation are only a few to mention when it comes to winning, especially in the State Youth Festivals. <br><br>\r\n  \r\nAdorned Kalaprathibha of Kottayam District three times, he has devoted himself to conventional art forms. Traditional music is what entices him and for the past 14 years he has been honing his skills in Carnatic music under Chengalam Haridas. Also a winner of \\\'Mambazham\\\' (Season 4) a poetry recital show in Kairali TV Jayadev has never sets his passion aside even for his busy life as a software engineer (.Net, WPF) in <strong>Palnar Transmedia, Technopark</strong>. <br><br>\r\n  \r\n  \r\nUndoubtedly he has won many fans in the Technopark Campus, with a single jam session during Nakshathra Deepangal, a musical night organized by NATANA in December 2011. With more in store for the techies, he is soon to lure us into his magical voice through  NAADAM... \r\n<br><br>', 'upload/1327931766_talent_tv.jpg', 'upload/1327931780_talent-big.jpg', 2, 2012, 1, 1);
