(4, 'Mr.', 'Sanjay', 'George', 'RMESI', 'sanjay.george77@gmail.com', '9895009250', 'Life means being serious when you need to be and being childish when you need to be. I enjoy life by trying to do things that other people would find impossible.', 'My role model is anyone who shows consideration for other people.', 'Playing the Piano and recording songs', 'My ideal partner is someone who is willing to do things that other people deem crazy', 'Y'),
(6, 'Mr.', 'Jitheesh', 'Khan', 'E-Team Informatica PVT. Ltd', 'jitheesh.s@eteamindia.com', '8893396374', 'Life for me is a mixture of challenges and surprises\r\nI enjoy it by facing these ', 'At the moment, it would imaginary person who has leadership quality of Jen-Hsun Huang, physique of Angelov Lazar, charisma of LOTR legolas.\r\nThis is because more or less i\'m trying to acheive these qualities. ', 'Gaming, watching movies,travelling', 'Ideal partner would be if she exists a person who knows me inside out and tell what my next move will be and vice versa', 'Y'),
(9, 'Mr.', 'shuaib', 'kunhabdulla', 'e team india', 'shuaib.k@eteamindia.com', '9447713524', 'The purpose of my life is to be happy.\r\n', 'rafael nadal is my role model. His passion and determination makes me so.and he work so hard to reach his success.', 'playing table tennis.', 'ideal partner means who we can share our happiness and sadness freely and me should feel her as my own for ever.', 'Y'),
(11, 'Ms.', 'chanchala', 'chanchu', 'ust-global', 'chanchala.chanchu@ust-global.com', '8129327065', 'for me life is a mixture of good and bad happening. We have to accept both and continue with our show.', 'My role model is my father. The way he is devoted to his work and family really inspires me a lot.', 'I love spending time in googling geographical areas.', 'an ideal partner is one who never need any explanation from your side and there is complete understanding even in mis understanding.', 'Y'),
(13, 'Ms.', 'Suman ', 'Kumari', 'UST Global', 'suman2012kumari@gmail.com', '8590106675', NULL, NULL, NULL, NULL, 'N'),
(14, 'Ms.', 'Susha ', 'Nagendran', 'IBS', 'susha.nagendran@ibsplc.com', '9048699130', 'Life as for me is \"live and let live\". I enjoy life by trying to make the best of everything.', 'My father. He is a multifaceted personality. I respect him for the different roles he adorns to perfection- a supporting husband,caring father, leading lawyer and a compassionate human being.', 'I enjoy driving and shopping ', 'I don\'t think there is anything like \"ideal partner\". I would rather call it companionship. A person who respects me for what i am and brings the best out of me would be my companion for life. It should be a  give and take relationship bonded by love care and trust. ', 'Y'),
(16, 'Mr.', 'Harsh', 'Bajpai', 'UST Global', 'harsh.bajpai@ust-global.com', '9567258377', 'Life for me is a celebration, a festival that I can enjoy in my own way,\r\noffering experiences unique all in itself everyday.\r\n\r\nI enjoy life by feeling every moment of life, every second counts, the feel\r\nof one day may not come again ever; life is a gift which we get only once in \r\nearth.So I beleive to live and let live, I enjoy life and by offering others\r\nwhatever help/services I can offer, I make their lives too a celebration to remember.', 'My role model is Mahatma Gandhi; Gandhi is the only person revered all around the world \r\nfor his ideals like truth, belief in God, self-discipline, ahimsa (non- violence) and \r\nSatyagraha. Gandhi opened way for Indiaâ€™s freedom by non-violence when everyone thought \r\nit is impossible. He showed what education should be by providing services to the \r\nsociety till his death. Gandhi was referred as â€œMahatmaâ€ (Mahaan Aathma or Great Spirit)\r\n by Tagore which showed the kind of impact he had on the mind of all. He was able to\r\n inspire people like Nelson Mandela, Albert Einstein, Steve Jobs, Barack Obama and other\r\n great people from various walks of life. He was able to inspire the common man. \r\nEinstein said: â€œGenerations to come wonâ€™t believe a person like Gandhi walked on this \r\nearthâ€ which showed his impact as a great inspiration. Martin Luther King Jr. famously\r\n said:â€ Christ gave us the lessons and Gandhi gave us the tacticsâ€ which sums up \r\nGandhiâ€™s impact on spirituality, politics and overall wellbeing. Moreover what inspired \r\nme most is his autobiography â€œMy experiments with truthâ€ where he openly admits his \r\nmistakes, the lies he has told and the way he later repented and this book itself is a \r\nbig inspiration for many. Gandhi served his nation and didnâ€™t made his family rich or \r\nfamous which is a rare fact that many people now wonâ€™t even think as possible.', 'My favourie past time is to read poems especially in Hindi and I enjoy writing\r\npoems to express my views and feelings. I love to read spiritual poems like that \r\nof Mr.Ravindranath Tagore that shows us the impact of life and also meaningful yet simple\r\npoems like that of Mr. Harivamshrai Bachchan.While I enjoy the ghazals and poems\r\nof Amir Khusrow,I equally enjoy realistic approach by Adam Gondvi and enigmatic\r\nlyrics from javed Akhtar or Gulzar who have even been famous in Hindi film industry.\r\nPoems touch the soul, they make us beleive that whatever we thought can be felt by others,\r\nwords become life and we flow in the river of poems along with the poet.These poems\r\nhelp me to establish a connection with my own life and make me feel like I am living\r\nmore lives and situations through these poems.\r\n', 'An ideal partner should be ideal, not that she should have all the qualities\r\nbut she should make me feel that she is the most special person I have ever\r\nmet in my life. My ideal partner is an ideal mix, not the best of everything, but a \r\ngenuine mix of all needed qualities. She should be caring, loving, trustworthy,friendly,\r\nspiritual enough, career oriented as well as family oriented. Women are always good in\r\nmulti tasking and I want her to multitask and enjoy life along with me.She should be ready\r\nto spend happiness and sorrows with me and be by my side in any situation that life\r\nposes, it is a journey of two souls with equal rights, so I want my wife to respect me\r\nthrough love and expect me to do the same.She should be adjusting as life is ever changing,\r\nshe should be imaginative and thoughtful especially when talking to elders without\r\nhurting them. She should be someone who can find time for me, our relatives, work and\r\neven for social causes;this way she will satisfy my concepts of perfection being my ideal\r\npartner.', 'Y'),
(17, 'Ms.', 'Anjana', 'Vijayadas', 'IBS Software Solutions', 'anjanavijayadas@gmail.com', '9895097525', 'Life to me is short of course. You just have one of it. Live it to the fullest, seek for things that make one happy, avoid hating people, give as much as love as you can, dare to do things no one would...that\'s that :) I have been in TRV for about 6 years now and we all know there\'s nothing great happening here. But still I love this place coz I have my friends, my small and sweet amazing family, my lil nephew I adore and could spend an eternity taking care of him. So I enjoy life by spending most of my time with the people I love, hang out with my girls, go for small drives, go Zumba, read a bit and sleep...that\'s me :)', 'Oprah Winfrey forever and always. It amazes me for how she came from nothing, was abused several times, had no one to help and now she is someone who everyone aspires to be. She\'s got it all. She\'s a BEAUTIFUL woman!', 'I like to read. A hobby I picked up about 2 years ago. I love driving alone. When alone, it gives me the liberty to be a little rash, you see ;) I love planning and organizing outings with my buddies. Love going to the movies, especially second shows and back-to-back shows', 'Mm tough one...even if I\'d want to have that \"ideal partner\" I wouldn\'t find him. The perfect guy doesn\'t exist. However, I wouldn\'t want to be too demanding and would say that my \"ideal guy\" should give me my space (very important), should love hanging out as much as me, should socialize. He can be good-looking and super rich! Nothing to lose with the added bonus ;)', 'Y'),
(18, 'Ms.', 'Aparna', 'Raj C', 'IBS Software Services', 'aparna.raj@ibsplc.com', '9388623972', 'Life is an opprotunity to spread happiness. It is to be useful for the society.\r\n\r\nI enjoy it the most when I am able to help others and bring a smile on the weary faces.', 'Dr. A.P.J. Abdul Kalam.\r\n\r\nThe former President\'s vision for the years to come, has been the best described and is absolutely achievable if Indians strive together. I believe him to be the equivalent of the visionaries at the time of Industrial Revolution who put forth their theories to be proved and developed over time.', 'Reading, Listening to orators. ', 'Selfless and Humble.', 'Y'),
(19, 'Mr.', 'Arun', 'Joy', 'IBS', 'arun.joy@ibsplc.com', '9037727615', 'life means family and relations to me. Enjoying life means to spend time with the loved ones and doing what i wish to do.', 'A fictitious character : Naruto\r\nWHY: survive through the toughest times, keep his bonds intact and never give up', 'sleeping, songs, travelling', 'a lady who can support, stand with me in toughest times, loving caring understanding (the common traits), fun loving and active nature(not dullish)', 'Y'),
(21, 'Mr.', 'amit', 'ranjan', 'IBS Software Services', 'amit.ranjan@ibsplc.com', '8129446183', 'For me life is a non-stop search for comfort and i enjoy my life being happy in whatsoever i do or get.', 'my role model is my mother, because she is my mentor since my birth till now and cent percent sure always will be', 'my favorite past time was my college days, nothing can change that.', 'ideal partner is the one who just have unconditional love for me.', 'Y'),
(22, 'Mr.', 'Tijo', 'Tom', 'Ges Infotek Private Ltd', 'tijotom1990@gmail.com', '9809956776', 'Life mean for HAPPINESS\r\nI enjoy life by making me and others HAPPY ', 'HRITHIK is my role model because hi is talented and he works hard to make it to the most extend', 'College Life', 'My Lover and  My Friend', 'Y'),
(23, 'Mr.', 'Jana ', 'Sreenivasan', 'GES Infotek', 'jana.s@gesinfotek.com', '9895367635', 'Life means moments .. Moments define life ... Create and cherish moments ... Live the moment. Stop, feel , enjoy. Smell the nature, feel the wind, hug your dad, kiss your mom.. Express your love .. Oh yeah, life is all about moments .. ', 'My role model is my father. He was a man bound to no rules and lived his life to the full .. Did, what he liked to do .. went, where he wanted to go .. I want to be so .. With out chains, fly as much as you wish , fly as high as you can ... No regrets !', 'It was an evening. We were at the beach side . \r\nShe was sitting near me in the beach sand. \r\nWe can see the sun setting down the horizon. \r\nIt was turning to orange. Clouds were moving around. \r\nThe beach wind was playing with her hair. \r\nShe was trying hard to manage it. \r\nI held her hand. She looked at me with a quizzing look. \r\nI looked into her eyes and words flowed out.\r\n\"Will you marry me?\" I asked. \r\nI saw her eyes welling up. I saw her lips trembling. She was barely able to whisper. \"Yes, yes, a million times\". Time went still... ', 'An ideal partner is the one who sees the real you through all the imperfections you have.... ', 'Y'),
(25, 'Mr.', 'Arun', 'Antony Marcelin', 'UST Global', 'arun.antonymarcelin@ust-global.com', '9947638383', 'Increasing the values.\r\n\r\ntrying self development and helping others.', 'Will Smith , Dan Milman ', 'Tried business.', 'Understanding and grow together.', 'Y'),
(26, 'Mr.', 'shabin', 'ghosh', 'IBS', 'shabin.ghosh@ibsplc.com', '9020199577', 'life means like no expectations. Just aim for what you want and enjoy and make the place favourable to enjoy', 'role model is gandhiji bcause evry youth should study from him for his dedicated, passion and ethical behaviour not for himself . but for whole community', 'sports, roaming, gardening, discussions on social events', 'Anideal partner should be a good friend ', 'Y'),
(27, 'Mr.', 'Anukrishnan', 'R', 'Ust Global', 'anuk1807@gmail.com', '9946054943', NULL, NULL, NULL, NULL, 'N'),
(28, 'Mr.', 'Jogi', 'Jacob', 'UST GLOBAL', 'jogijacob89@gmail.com', '9809034879', 'I go by the Shakespearean thought \"All the world\'s a stage\". Our life is an actor in this play. I want to make my Life count and my enjoyment in life is aimed at that..How small our life is , make it Large.', 'My role model is my father. I prefer having a role model whom i know personally and my father is  my hero since my childhood days..And a real role model takes birth, only when He/She can inspire another life.The ups the downs, the decisions he takes, the way he lives have influenced me and created a change in how i see this world.. ', 'My Favourite past time is listening to music, travelling, engaging in organisational activities.', 'To me a partner is someone who completes the circle of my life..I should see myself in that person and same as i said for my role model, the person should be able to inspire me.', 'Y'),
(29, 'Mr.', 'Zam ', 'Abdul Vahid', 'UST Global Pvt Ltd', 'zam.abdulvahid@ust-global.com', '9744157731', 'First of all I\'m very much thankful to the almighty for giving me this wonderful life. To me life is precious and the real meaning will come only when I\'m able to change the life\'s of at-least few people who are needy. The smile on their face will definitely give you that answer what I have achieved so far in my life.\r\n\r\n I enjoy life in my own ways. Being simple and taking time to enjoy what ever i\'m engaged at, whether its talking to someone, driving, working...', 'Haven\'t kept anyone as role model so far. The way i follow is Observe, Learn and Execute. \r\n\r\nWhy do we need to keep a person as role model to achieve in life. Accept the good things from everywhere, keep away from the negatives. \r\n\r\nIf for any reason your decisions went wrong then also you learnt something, try not to repeat it next time. Be confident in  yourself.', 'Love to go for long drives with music in the background, preferably light melody. \r\n\r\nSpending time with your buddies at the beach at late nights.  ', 'An ideal partner to me would be someone who respects each other and take cares of each other in good & bad times. They shouldn\'t try to put hands into each others freedom as well.\r\n\r\nIn my absence she must have the ability to run things, whether its taking care of house hold stuff, kids or what so ever.\r\n', 'Y'),
(30, 'Mr.', 'biju', 'ts', 'ust', 'biju.sundaran@ust-global.com', '9995245111', NULL, NULL, NULL, NULL, 'N');
